window.bookSummaryJSON = "<p><b>Second chances always come with a price.</b></p> <p>Colonel Liam Wessex is happy to see Jamie Callahan and Kyle Brannigan finally married, but it leaves him wishing his own life wasn’t such a mess. With his classified identity revealed to the British public, Liam struggles with the transition into civilian life. When MI6 Agent Oliver Archer stumbles back into his world, Liam has a second chance to make things right between them, if only the prickly agent would let him close again. </p> <p>Oliver thought he’d done enough to cut Liam out of his life for good after a disastrous night together during their youth. But when terrorists target London and Liam is called back to active duty, they’re forced to work together for the good of queen and country. Liam may not be the spoiled prince Oliver once knew, but that doesn’t make up for the heartache he caused. </p> <p>Amidst royal engagements and clandestine missions, Liam and Oliver find themselves facing a threat that could tear them apart all over again.</p>"; 
